import React from 'react';
import {BrowserRouter as Router , Routes , Route } from 'react-router-dom';
import './App.css';
import './style.css';
import Navbar from './root/layout/components/NavBar';
import Home from './root/layout/components/Home';
import EmployeeList from './employees/components/EmployeeList';
import StockList from './stocks/components/StockList';
import About from './root/layout/components/About';
import EmployeeDetails from './employees/components/EmployeeDetails';

class App extends  React.Component{
  constructor(props) {
    super(props);
    this.state={}
  }

  render() {
    return (
      <React.Fragment>
        <Router>
        <Navbar/>
          <Routes>
            <Route exact path='/' element={<Home/>} />
            <Route exact path='/employees' element={<EmployeeList/>}/>
            <Route exact path='/employees/:emp_id' element={<EmployeeDetails/>}/>
            <Route exact path='/stocks' element={<StockList/>} />
            <Route exact path='/about' element={<About/>} />
          </Routes>
        </Router>
      </React.Fragment> 
    );
  }
};
export default App;
